import Container from 'react-bootstrap/Container';

const MainFooter = () => (
  <footer>
    <div className='footer-wrapper'>
      <Container>
        <h3>
          StatMix
        </h3>
      </Container>
    </div>
  </footer>
);

export default MainFooter;
